class Calculadora extends React.Component{
    render() {
        return (
            <div>
            <div className="z-depth-2 cyan darken-3 white-text center-align resultados">Area de numeros</div>
            <div style={{textAlign: "center"}}>
                <a className="waves-effect waves-light cyan darken-3 btn">0</a>
                <a className="waves-effect waves-light cyan darken-3 btn">1</a>
                <a className="waves-effect waves-light cyan darken-3 btn">2</a>
            </div>
            <style jsx>{
                `
                .resultados {
                    width: 300px;
                    margin: 0 auto 10px auto;
                    font-size: 32px;
                }
                `
            }
            </style>
            </div>
        )
    }
}

export default Calculadora
